import React from 'react';

interface IProps {
  experience: Array<Experience>;
}

const Experience: React.SFC<IProps> = ({ experience }) => {
  console.log(experience)
  return (
    <section className="mw7 mt4 center tj">
      {
        experience.map((exp: any) => (
          <article className="pv4 bb b--black-10 ph3 ph0-l">
            <div className="flex flex-column flex-row-ns">
              <div className="w-100 pr3-ns order-2 order-1-ns">
        <h1 className="f3 athelas mt0 lh-title">{exp.title}</h1>
                <h3 className="athelas">{exp.company}</h3>
                <p className="f5 f4-l lh-copy athelas">
                  Code Tenderloin is a non-profit organization that teaches programming and economic empowerment to students with unfavorable backgrounds, in order to provide them with more opportunities and reduce the inequality of work that exists in the field of technology in San Francisco and the bay area. I am currently a TA in Code Tenderloin, in the Code Ramp ++ program, where JavaScript is taught. I give programming classes, mock interviews and extra class consultations.
                </p>
              </div>
            </div>
            <p className="f6 lh-copy gray mv0"><span className="ttu">{exp.status}</span></p>
          </article>
        ))  
      }
    </section>
  );
}

export default Experience;
